CREATE USER root_admin;
GRANT ALL PRIVILEGES ON DATABASE my_spaces_db TO root_admin;


DROP TABLE IF EXISTS Users;
CREATE TABLE Users (
    UserID          serial primary key,
    Username        text not null unique,
    UserPassword    text not null,
    Email           text not null unique,
    FirstName       text not null,
    LastName        text not null,
    PhoneNo         text not null unique, 
    IsAdmin         boolean,
    BSB             text check (BSB ~ '^\d{3}\-\d{3}$' or BSB = ''),    -- BSB must have format 000-000
    AccountNum      text check (AccountNum ~ '^\d+$' or AccountNum = '')       -- Account number can only contain digits
);

DROP TABLE IF EXISTS Listings;
CREATE TABLE Listings (
    ListingID       serial primary key,
    ListedBy        integer not null,
    HourlyPrice     integer not null check(HourlyPrice > 0),
    Notes           text,
    StreetNumber    integer not null check(StreetNumber > 0),
    Street          text not null,
    Suburb          text not null,
    Postcode        integer not null,
    Width           float check (Width > 0), -- All in meters
    Height          float check (Height > 0),
    Depth           float check (Depth > 0),
    Latitude        float not null,
    Longitude       float not null,
    Visible         boolean default true,
    Deleted         integer default 0 check (Deleted >= 0),
    unique (StreetNumber,Street,Suburb,Postcode,Deleted),
    foreign key (ListedBy) references Users(UserID)
);

-- TODO: Enddate cannot be before StartDate
DROP TABLE IF EXISTS Bookings;
CREATE TABLE Bookings (
    BookingID       serial primary key,
    BookedBy        integer not null,
    BookedSpace     integer not null,
    StartDate       timestamp not null, 
    EndDate         timestamp not null, 
    TotalCost       integer not null check (TotalCost > 0),
    Plate           text,
    CardNo          text,
    CardExpiry      text,
    SecurityCode    text,
    unique (BookedSpace, StartDate, EndDate), -- TODO: we must ensure that a when a listing is used up by a booking at a given time, that another booking cant be made at that time.
    foreign key (BookedBy) references Users(UserID),
    foreign key (BookedSpace) references Listings(ListingID)
);

DROP TABLE IF EXISTS Reviews;
CREATE TABLE Reviews(
    ReviewID        serial primary key,
    BookingID       integer not null unique,
    ReviewedListing integer not null,
    Username        text not null,
    Liked           boolean,
    Comment         text,
    foreign key (BookingID) references Bookings(BookingID),
    foreign key (ReviewedListing) references Listings(ListingID),
    constraint chk_contains_review check (Liked = true or (Comment is not null and Comment <> ''))
);

DROP TABLE IF EXISTS DirectionsAPICache;
CREATE TABLE DirectionsAPICache(
    ListingID       integer not null,
    Suburb          text not null,
    Duration        integer not null check (Duration > 0),
    Distance        float not null check (Distance > 0),
    TransitMethod   text,
    TransitSummary  text,
    Polyline        text not null,
    DateCached      timestamp not null,
    foreign key (ListingID) references Listings(ListingID),
    primary key (ListingID, Suburb)
);


CREATE OR REPLACE FUNCTION checkBookingTimes() RETURNS trigger AS $$
    BEGIN
            IF EXISTS (SELECT * FROM Bookings WHERE 
            (
                (StartDate between NEW.StartDate and NEW.EndDate) or 
                (EndDate between NEW.StartDate and NEW.EndDate) or 
                (NEW.StartDate between StartDate and EndDate) or
                (NEW.EndDate between StartDate and EndDate)
            )
                and BookedSpace = NEW.BookedSpace) THEN

            --RAISE EXCEPTION 'Space is unavailable at specified time';
            RAISE check_violation USING MESSAGE = 'Check Violation: (availability) check has been violated';

            END IF; 

        --  IF EXISTS (SELECT * From Bookings WHERE (EndDate between NEW.StartDate and NEW.EndDate) and BookedSpace = NEW.BookedSpace) THEN
        --      RAISE EXCEPTION 'Space is unavailable at specified time';
        --  END IF; 

            
        RETURN NEW;
    END;
$$ LANGUAGE plpgsql;


CREATE OR REPLACE TRIGGER checkBookingTimes
    BEFORE INSERT ON Bookings
    FOR EACH ROW
    EXECUTE FUNCTION checkBookingTimes();



